import React, { Component } from "react";
import { ProjectsData } from "./projectData";
import Project from "./project";
import { SwiperSlide } from "swiper/react";

class Projects extends Component {
  state = {};
  render() {
    var projectList = ProjectsData.map(function (project) {
      return (
        <SwiperSlide>
          <Project key={project.name} projectData={project} />
        </SwiperSlide>
      );
    });

    return <React.Fragment>{projectList}</React.Fragment>;
  }
}

class ProjectsMobile extends Component {
  state = {};
  render() {
    var projectList = ProjectsData.map(function (project) {
      return <Project key={project.name} projectData={project} />;
    });

    return <React.Fragment>{projectList}</React.Fragment>;
  }
}

export { Projects, ProjectsMobile };
